Director: Christian Alvert
Cast: Dennis Quaid, Ben Foster, Cam Gigandet, Antje Troy, Kung Le, Eddie Rous, Norman Ridus, Andre Hennicke, Friederike Kempter, Niels-Bruno Schmidt

In the depths of the cosmos is moving spaceship. Two members of the team, awakened from gipersna themselves in a difficult situation: the equipment does not work, remember they can not do anything. What was their mission? How long has it been? Where are they? Who are they? All these questions have no answers. In addition, the ship found strangers - evil warriors who krushat everything in its path. Space travelers have very little time. Now, for them their own lives - not the most important thing, because only two of them may depend the salvation of mankind. Must at all costs to restore control of the ship, until a mysterious Pandorum not take power into their own hands.

